import React, { Component } from 'react';
import {
    OwpButton,
    OwpSearchDateTimePickerMulti,
    OwpPageCarded,
    OwpSearchHeader,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpToolbar,
    OwpTreeGrid,
    OwpSearchAutoComplete,
    OwpDateTimePicker,
} from 'owp/wrapper';
import * as TGEvent from 'owp/TGEvent';
import Pop_C0806011 from '../../include/Pop_C0806011';
import Pop_C0807001 from '../../include/Pop_C0807001';


class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }


    render() {
        return (
            <React.Fragment>
                <OwpPageCarded
                    header={
                        <OwpSearchHeader url="listOwpProdplan">
                            <div className="w-full">
                                <div className="flex mb-16">
                                    <OwpDateTimePicker
                                        initNow
                                        label="연도"
                                        inputProps={{ style: { width: '160px', marginRight:'20px'}}}
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'PLC Tag No.'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'위치'}
                                        
                                    />
                                    <OwpSearchSelectField
                                        className="w-160"
                                        id={'sm05'}
                                        name={'sm05'}
                                        label="조회일자 유형"
                                        options={[
                                            { label: '주', value: '1' },
                                            { label: '월', value: '2' },
                                        ]}
                                        value={'1'}
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'주정주기'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'Range'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'Tag No.'}
                                        
                                    />
                                </div>
                                <div className="flex">
                                    <OwpSearchSelectField
                                        className="w-160"
                                        id={'sm05'}
                                        name={'sm05'}
                                        label="구분"
                                        options={[
                                            { label: '전체', value: '1' },
                                            { label: 'A', value: '2' },
                                        ]}
                                        value={'1'}
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm01'}
                                        name={'sm01'}
                                        label={'점검주기'}
                                        
                                    />
                                    <OwpSearchSelectField
                                        className="w-160"
                                        id={'sm05'}
                                        name={'sm05'}
                                        label="장비종류"
                                        options={[
                                            { label: '표준기기', value: '1' },
                                            { label: 'A', value: '2' },
                                        ]}
                                        value={'1'}
                                    />
                                    <OwpSearchSelectField
                                        className="w-160"
                                        id={'sm05'}
                                        name={'sm05'}
                                        label="교정기관"
                                        options={[
                                            { label: '외부교정', value: '1' },
                                            { label: 'A', value: '2' },
                                        ]}
                                        value={'1'}
                                    />
                                    
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm03'}
                                        name={'sm03'}
                                        label={'기타'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm03'}
                                        name={'sm03'}
                                        label={'구분'}
                                        
                                    />
                                    <OwpSearchAutoComplete
                                        className="w-160"
                                        id={'sm03'}
                                        name={'sm03'}
                                        label={'점검주기'}
                                        
                                    />
                                </div>
                            </div>
                        </OwpSearchHeader>
                    }
                    contentToolbar={
                        <OwpToolbar title="교정관리 표준기기">
                            <Pop_C0806011/>
                            <Pop_C0807001/>
                        </OwpToolbar>
                    }
                    content={
                        <React.Fragment>
                            <OwpTreeGrid
                                id="C0807000"
                                LayoutUrl={'/assets/data/C0807000Def.xml'}
                                DataUrl={'/assets/data/C0202000Data.xml'}
                            />
                        </React.Fragment>
                    }
                    innerScroll
                />
            </React.Fragment>
        );
    }
}

export default Page;
